import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';
import { Video } from '../classes/video';
import { Vocabulary } from '../classes/vocabulary';

@Injectable({
  providedIn: 'root'
})
export class ExercisesValueService {

  LessonId: Subject<number> = new Subject<number>();
  VideoId: Subject<number> = new Subject<number>();
  McqId: Subject<number> = new Subject<number>();
  ReadingId: Subject<number> = new Subject<number>();
  VocabularyValue: Subject<Vocabulary[]> = new Subject<Vocabulary[]>();
  VideoValue!: string;


  constructor() { }

  loadVideoExercise(video:string){
    this.VideoValue = video;
  }
  loadVocabularyExercise(VocabValue:Vocabulary[]){
    this.VocabularyValue.next(VocabValue);
  }
}
